// Navbar.js

import React, { useState } from 'react';
import './Navbar.css';
import { Link, Route, Routes } from 'react-router-dom';
import About from '../About/About';
import Contact from '../Contact/Contact';
import Employee from '../Employee/Employee';
import Crud from '../Crud/Crud';

function Navbar() {
  const [navOpen, setNavOpen] = useState(false);

  const toggleNav = () => {
    setNavOpen(!navOpen);
  };

  const closeNav = () => {
    setNavOpen(false);
  };

  return (
    <div className={`topnav ${navOpen ? 'responsive' : ''}`}>
      <button className="toggle-btn" onClick={toggleNav}>
        <i className={`fas ${navOpen ? 'fa-times' : 'fa-bars'}`}></i>
      </button>
      <button className="close-btn" onClick={closeNav}>
        <i className="fas fa-times"></i>
      </button>

      <Routes>
        <Route path="/About" element={<About />} />
        <Route path="/Contact" element={<Contact />} />
        <Route path="/Employee" element={<Employee />} />
        <Route path="/Crud" element={<Crud />} />
      </Routes>

      <nav>
        <ul>
          <li>
            <Link className="name" to="/">
              <i className="fa-solid fa-house"></i> Home
            </Link>
          </li>
          <li>
            <Link className="name" to="/Contact">
              <i className="fa-solid fa-phone"></i> Contact
            </Link>
          </li>
          <li>
            <Link className="name" to="/About">
              <i className="fa-regular fa-address-card"></i> About
            </Link>
          </li>
          <li>
            <Link className="name" to="/Employee">
              Employee
            </Link>
          </li>
          <li>
            <Link className="name" to="/Crud">
              Crud
            </Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Navbar;
